import { createAsyncThunk } from "@reduxjs/toolkit"
import axios from "axios"

const url = "localhost:5000/api/auth"

const PostDataLogin = createAsyncThunk(
    "read/pizza",
    async () => {
        return await axios.get(`${url}/login`) .then(
            res=>res.data.data
        )
    }
)

export {
    PostDataLogin
}
